import { PushAPI } from '@pushprotocol/restapi';
import { ethers } from 'ethers';

let photoEncoded =
  'data:image/png;base64,';

// Creating a random signer from a wallet, ideally this is the wallet you will connect
// const signer = ethers.Wallet.createRandom();
// console.log('signer-----------', signer)

// Initialize wallet user, pass 'prod' instead of 'staging' for mainnet apps

export async function createChat(signer) {
  const userAlice = await PushAPI.initialize(signer, { env: 'staging' });
  // Creating your token gated community
  const createTokenGatedGroup = await userAlice.chat.group.create(
    'TripBloc queries',
    {
      description: 'Secure chat between Platform, Hotel Owner and Customer', // provide short description of group
      image: photoEncoded, // provide base64 encoded image
      members: [], // not needed, rules define this, can omit
      admins: [], // not needed as per problem statement, can omit
      private: true,
      rules: {
        entry: {
          // entry is based on conditions
          conditions: {
            any: [
              // any of the decider should allow entry
              {
                // decider 1 - If admin or owner invites someone
                any: [
                  {
                    // criteria 1
                    type: 'PUSH',
                    category: 'ERC20',
                    subcategory: 'holder',
                    data: {
                      contract:
                        'eip155:1442:0xEF4f36c338a9518F5bb7519b90a97ef297657e73',
                      comparison: '>=',
                      amount: '1',
                      decimals: '18',
                    },
                  },
                ],
              },
            ],
          },
        },
      },
    }
  );
  console.log("push chat id",createTokenGatedGroup.chatId);
  return createTokenGatedGroup;
}
